    </div>
    <div v-if="page === 'fantastic'">
      <Fantastic v-on:addItemToCart="addItemToCart" :fantastic="fantastic"/>
    </div>
    <div v-if="page === 'historical'">
      <Historical v-on:addItemToCart="addItemToCart" :historical="historical"/>
    </div>
    <div v-if="page === 'products'">
